// pages/HomePage/WhyChooseUs.js
import React from "react";
import FeatureCard from "../../components/HomePage/FeatureCard";
import "../../styles/HomePage/WhyChooseUs.css";

const features = [
  { title: "24/7 Access", icon: "clock.svg", description: "Doctors & services available round the clock." },
  { title: "Affordable", icon: "rupee.svg", description: "Low-cost services for every citizen." },
  { title: "Nationwide Reach", icon: "map.svg", description: "Connecting every town and village." },
  { title: "Secure Records", icon: "shield.svg", description: "Your data is safe with us." },
];

const WhyChooseUs = () => {
  return (
    <section className="why-choose-us-section">
      <h2>Why Choose Us?</h2>
      <div className="features-grid">
        {features.map((feature, index) => (
          <FeatureCard key={index} title={feature.title} icon={feature.icon} description={feature.description} />
        ))}
      </div>
    </section>
  );
};

export default WhyChooseUs;
